import React, { Component } from 'react';
import 'react-bootstrap';

export default class Header extends Component{
    render(){
        return(
            <nav class ="navbar navbar-expand-lg" style="background-color: #0075BB">
                <button class="navbar-toggler" style="border-color: white" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo03" aria-controls="navbarTogglerDemo03" aria-expanded="false" aria-label="Toggle navigation">
                    <span class ="navbar-toggler-icon"></span>
                </button>
                <a href="" class="navbar-left"><img style="max-width:275px" src="../img/Allstate.jpg"/></a>


            </nav>

        )
    }
}
